import React from 'react';
import Aboutustext from './Aboutustext';
import Aboutimg from './Aboutimg';

const About = () => {
  return (
    <>
        <h1>this is About page</h1>
        <div className='container'>
    <div className='row'>
        <Aboutustext />
        <Aboutimg />
        </div>
        </div>
    </>
  )
}

export default About;
